    <View>
  <Text style={styles.text}>Welcome</Text>
  <Button
  title="Go to Component Demo"
  onPress={()=>{
    console.log("Button pressed");
  }}
  />
  </View>
  )
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30
  }
});

export default HomeScreen;
